def reach_top_stairs(n):
    # base cases
    if n == 1:
        return 1
    if n == 2:
        return 2
    # if we can take 1 step in 1 way
    if n % 2 == 0:
        return reach_top_stairs(n // 2)
    # if we can take 2 steps in 2 ways
    else:
        return reach_top_stairs(n // 2) + 1

